import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M4.75 4A2.75 2.75 0 002 6.75v10.5A2.75 2.75 0 004.75 20h6.75A6.5 6.5 0 0122 12.81V6.75A2.75 2.75 0 0019.25 4H4.75z", fill: primaryFill }),
        React.createElement("path", { d: "M23 17.5a5.5 5.5 0 10-11 0 5.5 5.5 0 0011 0zm-5 .5v2.5a.5.5 0 11-1 0V18h-2.5a.5.5 0 110-1H17v-2.5a.5.5 0 111 0V17h2.5a.5.5 0 110 1H18z", fill: primaryFill }));
};
const SlideAdd24Filled = wrapIcon(rawSvg({}), 'SlideAdd24Filled');
export default SlideAdd24Filled;
